function createLoadingOccupancyModel(dateArray){
        var num = 100;
        var lat=[1.350228,1.353864,1.353864];
        var lang=[103.984889,103.986498,103.986498];
        var imagesArray=['']
        for(var date=0;date<dateArray.length;date++){
                for(var hour=0;hour<23;hour++){
                        var minutesArr = [5,10,15,20,25,30,40,45]
                        for(var min=0;min<minutesArr.length;min++){
                                var elderlyQueueInfoObj = new elderlyQueueInfoModel();
                                var cameraExtrinsics = {
                                        "cameraId" : Math.round(Math.floor(Math.random() * 5) + 1),
                                        "cameraName" : "Under Route-"+(date%5)+date+" NorthboundBridge",
                                        "cameraDirection" : "Towards Northbound Lanes",
                                        "cameraLatitude" : lat[date%5],
                                        "cameraLongitude" : lang[date%5],
                                        "cameraHeight" : 30  // in feet from ground
                                };
                                var cameraIntrinsics = {
                                        "cameraFocalLength" : 35, // in mm
                                        "cameraAngle" : 20, // in degrees wrt horizontal plane
                                        "imageWidth" : "1920",
                                        "imageHeight" : "1080",
                                        "frameRate" : 25 // Frames per second
                                };
                                var elderlyQueueLevel= {
                                        berthIndex: Math.round(Math.floor(Math.random() * 9)+1),
                                        occupancy: Math.round(Math.floor(Math.random() * 90)),
                                        image:imagesArray[0]
                                }
                                elderlyQueueInfoObj.queueLevelInformation.cameraExtrinsics=cameraExtrinsics;
                                elderlyQueueInfoObj.queueLevelInformation.cameraIntrinsics=cameraIntrinsics;
                                elderlyQueueInfoObj.queueLevelInformation.elderlyQueueLevel=elderlyQueueLevel;
                                elderlyQueueInfoObj.queueLevelInformation.cameraExtrinsics=cameraExtrinsics;
                                var dateSet= dateArray[date];
                                dateSet.setHours(hour);
                                dateSet.setMinutes(minutesArr[min]);
                                var dateTimeOfIncident = new Date(dateSet);
                                elderlyQueueInfoObj.queueLevelInformation.dateTime = dateTimeOfIncident;
                                elderlyQueueInfoObj.queueLevelInformation.receivedDateTime = dateTimeOfIncident;
                                elderlyQueueInfoObj.save(function(err,result){
                                        if(err){
                                                console.log(err)
                                        }
                                        console.log(result.queueLevelInformation.dateTime+" Saved")
                                })
                        }
                }

        }

};